import React from 'react'

const TextInput = () => {
  return (
    <form className="InputForm">
        <div><input type="text" placeholder="E-mail" /></div>
        <div><input type="password" placeholder="Password" /></div>
        <div><input type="password" placeholder="Password" /></div>
        <input type="submit"></input>

    </form>
  )
}

export default TextInput
